化结节；轻度脂肪肝。\n2014年6月在包头市蒙医中医医院查腹部超声示：肝血管瘤，肝内钙化灶，胆囊炎，右肾小结石。2014年10月碱性磷酸酶155.9（15-112）、2014年12月碱性磷酸酶145（15-112）都偏高，2014年4月白蛋白34（35-55）偏低，前白蛋白152（180-400），2015年9月在309医院查腹部超声示：肝实性结节，胆胰腺肾膀胱乳腺双侧颈动脉声像未见异常。2016年在蒙医中医医院查全腹CT平扫示：肝左叶密度钙化影，肝右叶异常密度影与前片比较无明显变化，同年碱性磷酸酶192.3（15-112），谷氨酰转肽酶200.20U/L（≤50）。\n二、食管炎、胃息肉\n2014年3月在包头市中心医院查胃镜示：浅表性糜烂性胃炎，胃窦息肉（山田II型）。2015年9月在309医院查静脉麻醉下胃肠镜示：1.食管炎（Ⅰ级）2.胃息肉（Ⅱ级）。\n\n','2017-11-07','2017-11-07',3,3,'已通过',NULL,NULL),(63,46,5,'1、贫血','1、贫血','一、缺铁性贫血\n2014年4月在北京协和医院查血常规示：血红蛋白 90g/L，红细胞压积 29.3%，红细胞体积分布宽度 23.3。2014年10月在包头市蒙医中医医院查血常规示：血红蛋白 105g/L，红细胞压积 32%，红细胞体积分布宽度 72.6。2015年9月在309医院查体：血红蛋白 98g/L，红细胞压积 28.2%，红细胞体积分布宽度 40.9。2016年3月在蒙医中医医院查血常规示：血红蛋白105g/L，红细胞压积32%，红细胞平均体积83.3fl(86-110),红细胞分布宽度SD 50.8(37-50%),红细胞分布宽度16.9（1-15%）。\n\n','一、缺铁性贫血\n2014年4月在北京协和医院查血常规示：血红蛋白 90g/L，红细胞压积 29.3%，红细胞体积分布宽度 23.3。2014年10月在包头市蒙医中医医院查血常规示：血红蛋白 105g/L，红细胞压积 32%，红细胞体积分布宽度 72.6。2015年9月在309医院查体：血红蛋白 98g/L，红细胞压积 28.2%，红细胞体积分布宽度 40.9。2016年3月在蒙医中医医院查血常规示：血红蛋白105g/L，红细胞压积32%，红细胞平均体积83.3fl(86-110),红细胞分布宽度SD 50.8(37-50%),红细胞分布宽度16.9（1-15%）。\n\n','2017-11-07','2017-11-07',3,3,'已通过',NULL,NULL),(64,46,6,'1、甲状腺炎','1、甲状腺炎','一、甲状腺炎： \n2015年9月在309医院查甲状腺超声示：甲状腺肿大，甲状腺弥漫性病变。查甲功七项显示：促甲状腺激素TSH 7.41 mmol/L，抗甲状腺过氧化物酶抗体 342.64 mmol/L，余结果未见异常。\n\n','一、甲状腺炎： \n2015年9月在309医院查甲状腺超声示：甲状腺肿大，甲状腺弥漫性病变。查甲功七项显示：促甲状腺激素TSH 7.41 mmol/L，抗甲状腺过氧化物酶抗体 342.64 mmol/L，余结果未见异常。\n\n','2017-11-07','2017-11-07',3,3,'已通过',NULL,NULL),(65,46,8,'1、脑基底节区腔梗；\n2、右侧放射冠区缺血灶，大脑镰脂肪瘤。','1、脑基底节区腔梗；\n2、右侧放射冠区缺血灶，大脑镰脂肪瘤。','一、脑基底节区腔梗\n2014年7月在包头市中心医院查PET/CT示：双侧大脑基底节区多发腔梗。2015年9月在309医院查经颅多普勒检查示：双侧颞窗探测不太理想，椎动脉及基底动脉血流速度及频谱形态未见明显异常；同时查脑血流图示：未见异常。\n二、右侧放射冠区缺血灶，大脑镰脂肪瘤\n2016年3月在蒙医中医医院查头颅CT平扫示：右侧放射冠区缺血灶，大脑镰脂肪瘤。\n','一、脑基底节区腔梗\n2014年7月在包头市中心医院查PET/CT示：双侧大脑基底节区多发腔梗。2015年9月在309医院查经颅多普勒检查示：双侧颞窗探测不太理想，椎动脉及基底动脉血流速度及频谱形态未见明显异常；同时查脑血流图示：未见异常。\n二、右侧放射冠区缺血灶，大脑镰脂肪瘤\n2016年3月在蒙医中医医院查头颅CT平扫示：右侧放射冠区缺血灶，大脑镰脂肪瘤。\n','2017-11-07','2017-11-07',3,3,'已通过',NULL,NULL),(66,46,10,'1、膀胱炎','1、膀胱炎','一、膀胱炎：\n病程7年，反复发作，频繁血尿，服用抗生素可缓解，多次超声检查示膀胱三角区毛糙；2016-9-26在北京协和医院行尿FISH检查未见肿瘤细胞。\n\n','一、膀胱炎：\n病程7年，反复发作，频繁血尿，服用抗生素可缓解，多次超声检查示膀胱三角区毛糙；2016-9-26在北京协和医院行尿FISH检查未见肿瘤细胞。\n\n','2017-11-07','2017-11-07',3,3,'已通过',NULL,NULL),(67,46,9,'1、双膝骨性关节炎；\n2、腰椎退行性骨关节病、腰椎前滑脱（I度）；\n3、骨质疏松；\n4、颈椎病；\n5、右侧髂骨异常密度影：考虑骨岛。','1、双膝骨性关节炎；\n2、腰椎退行性骨关节病、腰椎前滑脱（I度）；\n3、骨质疏松；\n4、颈椎病；\n5、右侧髂骨异常密度影：考虑骨岛。','一、双膝骨性关节炎、双膝关节膝内翻\n病程30余年，未行特殊治疗。2013年4月在包头市中心医院查膝关节正侧位片示：双膝关节间隙不对称变窄硬化，诸骨可见骨唇改变，胫骨平台平坦。2013年5月在北京德尔康尼骨科医院查膝关节正侧位片示：1.两侧膝关节内翻畸形。2两侧膝关节退行性骨关节病。2015年9月在309医院查外科示：双膝关节退行性变膝内翻。\n二、腰椎退行性骨关节病、腰椎前滑脱（I度） \n2013年5月在北京德尔康尼骨科医院查腰椎X线示：1.腰椎退行性骨关节病。2.腰4前滑脱（I度）。2014年7月在包头市中心医院查PET/CT示：颈胸腰椎多发骨质疏松及骨质增生，L4椎体向前轻度滑脱，L3/4，L4/5，L5/S1间盘突出，T10/11，T11/12间盘变性。\n三、骨质疏松\n2015年9月在309医院查体示：骨质疏松。\n四、颈椎病\n2016年3月在蒙医中医医院查颈椎椎间盘CT平扫示：颈椎骨质增生，C34、C45椎间盘突出。\n五、右侧髂骨异常密度影：考虑骨岛\n2016年3月在蒙医中医医院查腹部CT平扫示：右侧髂骨异常密度影，考虑：骨岛。','一、双膝骨性关节炎、双膝关节膝内翻\n病程30余年，未行特殊治疗。2013年4月在包头市中心医院查膝关节正侧位片示：双膝关节间隙不对称变窄硬化，诸骨可见骨唇改变，胫骨平台平坦。2013年5月在北京德尔康尼骨科医院查膝关节正侧位片示：1.两侧膝关节内翻畸形。2两侧膝关节退行性骨关节病。2015年9月在309医院查外科示：双膝关节退行性变膝内翻。\n二、腰椎退行性骨关节病、腰椎前滑脱（I度） \n2013年5月在北京德尔康尼骨科医院查腰椎X线示：1.腰椎退行性骨关节病。2.腰4前滑脱（I度）。2014年7月在包头市中心医院查PET/CT示：颈胸腰椎多发骨质疏松及骨质增生，L4椎体向前轻度滑脱，L3/4，L4/5，L5/S1间盘突出，T10/11，T11/12间盘变性。\n三、骨质疏松\n2015年9月在309医院查体示：骨质疏松。\n四、颈椎病\n2016年3月在蒙医中医医院查颈椎椎间盘CT平扫示：颈椎骨质增生，C34、C45椎间盘突出。\n五、右侧髂骨异常密度影：考虑骨岛\n2016年3月在蒙医中医医院查腹部CT平扫示：右侧髂骨异常密度影，考虑：骨岛。','2017-11-07','2017-11-07',3,3,'已通过',NULL,NULL),(68,46,11,'1、子宫肌瘤；\n2、双侧乳腺增生。\n','1、子宫肌瘤；\n2、双侧乳腺增生。\n','一、子宫肌瘤：\n2014年6月在包头市蒙医中医医院查腹部超声示：子宫肌瘤。2015年9月在309医院查腹部超声示：子宫肌瘤2.3×2.9cm。\n二、双侧乳腺增生：\n2014年7月在包头市中心医院查PET/CT示：双侧乳腺增生，右侧乳腺点状钙化。\n','一、子宫肌瘤：\n2014年6月在包头市蒙医中医医院查腹部超声示：子宫肌瘤。2015年9月在309医院查腹部超声示：子宫肌瘤2.3×2.9cm。\n二、双侧乳腺增生：\n2014年7月在包头市中心医院查PET/CT示：双侧乳腺增生，右侧乳腺点状钙化。\n','2017-11-07','2017-11-07',3,3,'已通过',NULL,NULL),(69,46,16,'1、多颗牙齿缺失；','1、多颗牙齿缺失；','一、牙缺失\n2015年9月在309医院查口腔科示：多颗牙齿缺失。\n','一、牙缺失\n2015年9月在309医院查口腔科示：多颗牙齿缺失。\n','2017-11-07','2017-11-07',3,3,'已通过',NULL,NULL),(70,46,14,'1、视网膜动脉硬化I级','1、视网膜动脉硬化I级','一、视网膜动脉硬化I级\n2015年9月在309医院查眼科示：视网膜动脉硬化I级。\n\n','一、视网膜动脉硬化I级\n2015年9月在309医院查眼科示：视网膜动脉硬化I级。\n\n','2017-11-07','2017-11-07',3,3,'已通过',NULL,NULL),(71,46,13,'1、结肠Ca术后；\n2、结肠癌肝转移术后\n','1、结肠Ca术后；\n2、结肠癌肝转移术后\n','一、结肠癌术后\n患者于2014年4月因“结肠癌”在北京协和医院行“经腹腔镜右半结肠切除术”，病理诊断：结肠中分化腺癌，部分为粘液腺癌，侵透肌层达周围脂肪组织，肠周脂肪组织中可见癌结节形成。术后在内蒙当地医院行奥沙利铂+希罗达（卡培他滨）化疗方案4疗程，后因患者无法耐受停止。\n\n二、结肠癌肝转移术后\n2016年10月因“结肠癌肝转移”在北京协和医院行“右肝联合肝段切除（Ⅴ、Ⅵ段）+胆囊切除术”。术后石蜡病理回报：1、（右肝肿物及胆囊）粘液腺癌，结合病史，符合结肠癌肝转移，紧邻被膜，离断面及胆管切缘净；慢性胆囊炎；（胆管内栓子）粘液样物中见少许上皮细胞团。2、免疫组化结果：PMS-2(+)，MLH-1(-)，MSH-6(+)，MSH-2(+)。术后恢复良好，未进行化疗，给予胸腺法新（日达仙）注射及中医调理的等辅助治疗，定期复查肿瘤标志物、肝功及腹部影像学。\n近几个月发现肿瘤标志物CEA、CA19-9似有升高趋势，于2017-9-18在301医院行“肝胆脾MRI平扫+动态增强”检查示:“肝脏病变术后改变，与2017-4-26片对比，切缘处异常信号影较前增大（2.4×2.8×2.9cm），考虑为术后改变可能；病变前方少血供结节（2.7cm），不除外肿瘤复发；建议结合临床其他相关检查”。于2017-9-21在海军总医院行PET-CT检查示：“肝右叶术后改变，术区切缘低密度结节影（直径约1.7cm），葡萄糖代谢异常增高，考虑转移瘤表现，不除外临近肠管受侵；病变后方低密度影，葡萄糖代谢无增高，考虑术后改变”。\n\n','一、结肠癌术后\n患者于2014年4月因“结肠癌”在北京协和医院行“经腹腔镜右半结肠切除术”，病理诊断：结肠中分化腺癌，部分为粘液腺癌，侵透肌层达周围脂肪组织，肠周脂肪组织中可见癌结节形成。术后在内蒙当地医院行奥沙利铂+希罗达（卡培他滨）化疗方案4疗程，后因患者无法耐受停止。\n\n二、结肠癌肝转移术后\n2016年10月因“结肠癌肝转移”在北京协和医院行“右肝联合肝段切除（Ⅴ、Ⅵ段）+胆囊切除术”。术后石蜡病理回报：1、（右肝肿物及胆囊）粘液腺癌，结合病史，符合结肠癌肝转移，紧邻被膜，离断面及胆管切缘净；慢性胆囊炎；（胆管内栓子）粘液样物中见少许上皮细胞团。2、免疫组化结果：PMS-2(+)，MLH-1(-)，MSH-6(+)，MSH-2(+)。术后恢复良好，未进行化疗，给予胸腺法新（日达仙）注射及中医调理的等辅助治疗，定期复查肿瘤标志物、肝功及腹部影像学。\n近几个月发现肿瘤标志物CEA、CA19-9似有升高趋势，于2017-9-18在301医院行“肝胆脾MRI平扫+动态增强”检查示:“肝脏病变术后改变，与2017-4-26片对比，切缘处异常信号影较前增大（2.4×2.8×2.9cm），考虑为术后改变可能；病变前方少血供结节（2.7cm），不除外肿瘤复发；建议结合临床其他相关检查”。于2017-9-21在海军总医院行PET-CT检查示：“肝右叶术后改变，术区切缘低密度结节影（直径约1.7cm），葡萄糖代谢异常增高，考虑转移瘤表现，不除外临近肠管受侵；病变后方低密度影，葡萄糖代谢无增高，考虑术后改变”。\n\n','2017-11-07','2017-11-07',3,3,'已通过',NULL,NULL),(73,46,15,'1、双扁桃体肿大Ⅲ度。','1、双扁桃体肿大Ⅲ度。','一、咽扁桃体肿大\n2015年9月在309医院查耳鼻喉科示：双扁桃体肿大Ⅲ度。\n\n','一、咽扁桃体肿大\n2015年9月在309医院查耳鼻喉科示：双扁桃体肿大Ⅲ度。\n\n','2017-11-07','2017-11-07',3,3,'已通过',NULL,NULL),(74,46,1,'1、	主要生命体征\n2、	个人史家族史\n3、	目前主要用药\n','1、	主要生命体征\n2、	个人史家族史\n3、	目前主要用药\n','一、主要生命体征\n身高155cm，体重60kg，体重指数；\n血压120/70mmHg，心率64bpm，呼吸次/分，体温℃；\n腰围91cm，臀围98cm，腰臀比。\n二、个人史家族史\n1、个人史：去痛片过敏史（？）。2014年因“结肠癌”行右半结肠切除术；2016年因“结肠癌肝转移”行右肝联合肝段切除（Ⅴ、Ⅵ段）+胆囊切除术。\n2、家族史：母亲患宫颈癌，姐姐患直肠癌。\n三、目前主要用药\n\n\n','一、主要生命体征\n身高155cm，体重60kg，体重指数；\n血压120/70mmHg，心率64bpm，呼吸次/分，体温℃；\n腰围91cm，臀围98cm，腰臀比。\n二、个人史家族史\n1、个人史：去痛片过敏史（？）。2014年因“结肠癌”行右半结肠切除术；2016年因“结肠癌肝转移”行右肝联合肝段切除（Ⅴ、Ⅵ段）+胆囊切除术。\n2、家族史：母亲患宫颈癌，姐姐患直肠癌。\n三、目前主要用药\n\n\n','2017-11-07','2017-11-07',3,3,'已通过',NULL,NULL),(75,61,1,'123','123','123','123','2018-01-06','2018-01-06',65,3,'已通过',NULL,'<未说明原因>'),(76,61,2,'123','123','123','123','2018-01-06','2018-01-06',65,3,'已通过',NULL,NULL),(77,82,14,'','干眼症','','','2018-02-05','2018-02-05',55,NULL,'录入中',NULL,NULL);
