CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_num` varchar(64) DEFAULT '',
  `username` varchar(64) NOT NULL,
  `password` varchar(64) DEFAULT NULL,
  `avatar` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `role` varchar(64) DEFAULT NULL,
  `staff_id` int(32) DEFAULT NULL,
  `staff_mgr_id` int(32) DEFAULT NULL,
  `valid` date DEFAULT NULL,
  `birth` varchar(255) DEFAULT NULL COMMENT '出生日期',
  `gender` varchar(64) DEFAULT NULL COMMENT '性别',
  `id_card` varchar(64) DEFAULT NULL COMMENT '身份证号',
  `physical_condition` varchar(256) DEFAULT NULL COMMENT '身体状况',
  `marital_status` varchar(256) DEFAULT NULL COMMENT '婚姻状况',
  `medical_care` varchar(64) DEFAULT NULL COMMENT '医疗费别',
  `hospital` varchar(256) DEFAULT NULL COMMENT '医保定点医院',
  `insurance` varchar(256) DEFAULT NULL COMMENT '商业健康保险',
  `allergy_drug` varchar(256) DEFAULT NULL COMMENT '过敏_药物',
  `allergy_others` varchar(255) DEFAULT NULL COMMENT '过敏_其他',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=98 DEFAULT CHARSET=utf8;
